Observationen nur mit zwischenstaatlicher Instanz nach Strafprozessordnung! #Versicherungsspitzel #ATSG @Referendum_CH https://t.co/VKte1M0RF7 https://t.co/Uj3iBDS92G

@Akadierin @bronzeshirt Genau! Das war bisher auch der einzige Unterschied, den ich feststellen konnte.
Meine Folgerung: #Versicherungsspione richten sich gegen Arme, und nicht gegen Betrug.
Traurig!

@gregorbachmann Ja, jetzt wo per Gesetz festgeschrieben werden soll, dass Versicherungen private Geheimdienste betreiben können, schreie ich auf: richtig.
Vorher konnte jeder die Voyeure, Spanner und Stalker noch anzeigen.
#ATSG #Spitzelindustrie #Abst18 #CHvote #Versicherungsspitzel

@kaiser_liberal @Jungfreisinnige Das ist sehr enttäuschend, weil das Gesetz skandalös ist - er wirft den #Rechtsstaat über Bord: viel Text muss man nicht lesen, um das zu blicken.
Das ist liberal und freiheitlich gesehen Unsinn.
#ATSG #Abst18 #CHvote #Spitzelindustrie #Versicherungsspitzel

