@tagesanzeiger Das ganze unwürdige #Sozialhilfe Kabarett und #Sozialdetektive wird sich mit #Grundeinkommen #BGE #UBI erübrigen.
Wann endlich wird die Zukunft ernsthaft angegangen?
#Politiker sollten weiter denken als nur in Wahlperioden

